import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // 1. Locate the search input and type a partial query
    const searchInput = page.locator('#searchInput');
    await searchInput.waitFor({ state: 'visible', timeout: 5000 });
    await searchInput.fill('electro');

    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_after_typing.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_after_typing.png'));

    // 2. Wait for the search suggestions to appear
    const suggestionsContainer = page.locator('.search-suggestions');
    await suggestionsContainer.waitFor({ state: 'visible', timeout: 5000 });

    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_suggestions_visible.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_suggestions_visible.png'));

    // 3. Select and click a specific suggestion
    const suggestionToClick = page.locator('.suggestion-item', { hasText: 'Electronics' }).first();
    const suggestionText = await suggestionToClick.textContent();
    await suggestionToClick.click();

    await page.screenshot({ path: path.join(screenshotsDir, 'step_4_after_click.png') });
    screenshots.push(path.join(screenshotsDir, 'step_4_after_click.png'));

    // 4. Verify the input value was updated
    const finalInputValue = await searchInput.inputValue();

    if (finalInputValue !== suggestionText) {
      throw new Error(`Search input value was not updated correctly. Expected "${suggestionText}", but got "${finalInputValue}".`);
    }

    return {
      success: true,
      action: "Successfully tested search autocomplete by typing, selecting a suggestion, and verifying the input update.",
      extractedData: {
        typedQuery: 'electro',
        clickedSuggestion: suggestionText,
        finalInputValue: finalInputValue
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to test search autocomplete",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
